#funkcja v z tabeli
funkcja_v = lambda t: sqrt(abs(funkcja_x(t)*funkcja_z(t)+10))*(abs(funkcja_y(t) + 1.2))*sin(2*pi*t)
v = generate_signal(funkcja_v, f_s, T)
plt.plot(range(len(v)), v)
plt.title("Sygnal v z tabeli")

